import React from 'react';

const Video_item = (props) => (
        <li>
            {props.video.snippet.title}
            {props.video.snippet.thumbnails.medium.url}

            <img src={props.video.snippet.thumbnails.medium.url}
            alt="video thumbnail"/>
        </li>
    );

export default Video_item;
